import '../App.css'
import React from 'react';
import styled from 'styled-components'
import imgRestaurants from "../../images/restaurants.png"

const Restaurants = styled.div`

background-image: url(${imgRestaurants});
color: white;

  `

export default () => {
    return (
        <div>
            <Restaurants>
               <h1>Restaurants</h1>
            </Restaurants>

        </div>
    )

}
